import { Bar } from 'react-chartjs-2';

const Dashboard = ({ data }) => {
  const chartData = {
    labels: ['Заголовки', 'Метатеги', 'Скорость'],
    datasets: [{
      label: 'SEO-оценка',
      data: [data.headingsScore || 0, data.metaTagsCount || 0, data.speedScore || 0],
      backgroundColor: ['#36A2EB', '#FFCE56', '#4BC0C0']
    }]
  };

  return (
    <div>
      <h2>Результаты анализа</h2>
      <Bar data={chartData} />
    </div>
  );
};

export default Dashboard;
